import "../styles/ClinicalHome.css";
import React, { useEffect, useState } from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
import doctorPhoto from '../assets/doctorphoto.jpeg';
import ClinicalSidebar from "./ClinicalSidebar.js"; // Import the ClinicalSidebar component
function DoctorHome() {
  const navigate = useNavigate();

    // State for dashboard data
    const [dashboardData, setDashboardData] = useState({

    });
    const [clinicalStaffName, setClinicalStaffName] = useState('');
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8070';
    useEffect(() => {
      const fetchDashboardData = async () => {
        const token = localStorage.getItem('token');
        if (!token) {
          navigate('/'); // Redirect to login if no token
          return;
        }
  
        try {
          // Decode the JWT token to get the doctor's name
          const tokenPayload = JSON.parse(atob(token.split('.')[1])); // Decode the token
          setClinicalStaffName(tokenPayload.name);
  
          // Fetch dashboard data
          const response = await fetch(`${API_BASE_URL}/api/clinicalstaff/dashboard`, {
            headers: { Authorization: `Bearer ${token}` },
          });
  
          if (!response.ok) {
            if (response.status === 401) {
              setError('Session expired. Please log in again.');
              localStorage.removeItem('token');
              navigate('/');
            } else {
              throw new Error('Failed to fetch dashboard data');
            }
          } else {
            const data = await response.json();
            setDashboardData(data);
          }
        } catch (error) {
          console.error('Error fetching dashboard data:', error);
          setError('Failed to load dashboard data. Please try again.');
        } finally {
          setLoading(false);
        }
      };
  
      fetchDashboardData();
    }, [navigate, API_BASE_URL]);
  
    const handleLogout = () => {
      localStorage.removeItem('token');
      navigate('/');
    };
  
    const today = new Date().toLocaleDateString('en-US', {
      weekday: 'long',
      month: 'long',
      day: 'numeric',
    });
  
    return (
    <div className="clinical-home-container">
      <aside className="sidebar">
        <div className="logo">CarePlus</div>
        <div style={{ display: "flex" }}>
      <ClinicalSidebar />

    </div>
        <nav>
          <ul>
            <li>Bill</li>
            <li>Report</li>
            <li>Settings</li>
          </ul>
        </nav>
      </aside>
      <main className="main-content">
        <header className="header">
          <div>Prescriptions</div>
          <div className="profile">Clinical Staff</div>
        </header>
        <div className="content">
          <div className="patient-list">
            <h3>Totally 50 Patients</h3>
            <ul>
              {["Naduni Kumari", "Saman Kumara", "P. Karunathilake", "Sachini Samarasinghe", "A.B.S. Seetha", "Sandun Gamage"].map((name, index) => (
                <li key={index}>{name}</li>
              ))}
            </ul>
            <button className="see-all">see all</button>
          </div>
          <div className="fee-details">
            <input type="text" placeholder="Search" />
            <div className="fee-info">
              <h4>Naduni Kumari</h4>
              <div>Doctor fee: <input type="text" /></div>
              <div>Report fee: <input type="text" /></div>
              <div>Clinicâ€™s fee: <input type="text" /></div>
              <div>Total fee: <input type="text" /></div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default ClinicalHome;
